public class Slide46_NestedForLoops {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i;
		for(i=1;i<=5;++i) {
			for(int j=1; j<=2; ++j) {
				System.out.println("Inside loop");
			}
			System.out.println("Outside loop");
		}

	}

}
